              <MenuIcon />
            </IconButton>
            <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
              Breaking Bad
            </Typography>
            <Button color="inherit" 
            onClick={handleOpen}
            >
              Login
            </Button>
          </Toolbar>
        </AppBar>
      </Box>

      <div>
        {/* <Modal open={open}>
